import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'

import VueToast from 'vue-toast-notification';
Vue.use(VueToast, {
  position: 'top'
});


import AOS from 'aos';
import 'aos/dist/aos.css';
AOS.init();

Vue.config.productionTip = false

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
